import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import { Box, IconButton } from '@material-ui/core';
import PropTypes from 'prop-types';
import Text from '../text';

const styles = (theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
  },
  headerWrapper: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  subWrapper: {
    display: 'flex',
    flexDirection: 'column',
  },
  arrowWrapper: {
    display: 'flex',
    flexDirection: 'row',
    width: 120,
  },
  leftArrow: {},
  commonTStyle: {
    margin: 0,
    lineHeight: 1,
  },
  scrollPad: {
    paddingLeft: 5,
    paddingRight: 5,
  },
});

const Carousel = ({ classes, title, subTitle, children }) => (
  <Box className={classes.root}>
    <Box className={classes.headerWrapper}>
      <Box className={classes.subWrapper}>
        <Box>
          <Text
            ffamily="Poppins"
            fWeight={500}
            variant="body1"
            className={classes.commonTStyle}
          >
            {title}
          </Text>
        </Box>
        <Box>
          <Text
            ffamily="Poppins"
            fWeight={700}
            variant="h4"
            color="#34A76C"
            className={classes.commonTStyle}
          >
            {subTitle}
          </Text>
        </Box>
      </Box>
      <Box className={classes.navStyle}>
        <IconButton className={classes.iconButton} onClick={previousDiv}>
          <Box className={classes.previous} />
        </IconButton>
        <IconButton className={classes.iconButton} onClick={nextDiv}>
          <Box className={classes.next} />
        </IconButton>
      </Box>
    </Box>
    <Box className={classes.scrollPad}>{children}</Box>
  </Box>
);

Carousel.propTypes = {
  title: PropTypes.string,
  subTitle: PropTypes.string,
  // eslint-disable-next-line react/forb,id-prop-types
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Carousel);
